import React from "react";
import "tachyons";

const Card = props => {
  return (
    <div className="tc bg-light-green dib pa3 ma2 grow bw2 shadow-5">
      <div>
        <img alt="robots" src={`https://robohash.org/${props.id}?200x200`} />
        <h2>{props.name}</h2>
        <p> {props.email}</p>
      </div>
    </div>
  );
};

export default Card;
